import Layout from "../components/Layout";
// components/Tile.js
import styles from './index.module.css'
import Tile from "../components/Tile";

const Home = () => (
    <Layout>
        <ul className={styles.tileList}>
            <li><a><Tile h1="Statistics Calculator" src={"/calculator.png"} title="Machine Learning"
            text="Two predictive machine learning models on determining new policyholders' risk 
            on car insurance claims, and secondly for music taste by location."></Tile></a></li>
            <li><Tile></Tile></li>
        </ul>


    </Layout>
);

export default Home;
